script: |
  super -f text -I q4468.spq | sort > q4468.out

inputs:
  - name: q4468.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE ( col2 * + col0 ) NOT BETWEEN + col0 AND 58 + ( + col1 - 48 ) * + 17;
  - name: tab1

outputs:
  - name: q4468.out
    data: |
      51	14	96
      85	5	59
      91	47	68
